import React from "react";
import Button from 'react-bootstrap/Button'
import Card from 'react-bootstrap/Card'
import { useState } from "react";
import "../main.css"


function LoginPage() {

    const [showCreateAccount, setShowCreateAccount] = useState(false)

    return (
        <div className="" style={{ paddingTop: '4rem' }}>
            <div className="container d-flex flex-row align-items-center justify-content-center" style={{ maxWidth: '400px' }}>
                <Card style={{ width: '18rem' }}>
                    <Card.Body className="d-flex flex-column justify-content-center align-items-center">
                        <Card.Title style={{ paddingTop: '25px' }}>SLVSH BRACKET</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted" style={{ paddingTop: '10px' }}>Welcome</Card.Subtitle>
                        <Button style={{ marginTop: '25px' }} >Login</Button>
                        <div className="" style={{ paddingTop: '15px' }}>or</div>
                        <Card.Link className="hover-pointer" onClick={() => { setShowCreateAccount(!showCreateAccount) }} style={{ paddingTop: '15px' }}>Create Account</Card.Link>
                        {showCreateAccount &&
                            <div className="">
                                <input type="text" name="" id="" />
                                <input type="text" name="" id="" />
                            </div>

                        }
                    </Card.Body>
                </Card>
            </div>
        </div>
    );
}

export default LoginPage;
